import ProfessionalPhoto from "../assets/professional_photo.jpg";
import LinkedInFilled from "../assets/linkedin-filled.png";
import LinkedIn from "../assets/linkedin.png";
import GitHubFilled from "../assets/github-filled.png";
import GitHub from "../assets/github.png";

import classNames from "classnames";
export const LinksSection = () => {
  return (
    <div className={"links-section"}>
        <div className="image-hover"></div>
      <div className={classNames("name", "links-section-column")}>
        Najja Kossally
      </div>
      <div className="links-section-column">
        <img className={"professional-photo"} src={ProfessionalPhoto} />
      </div>

      <div>
        <a
          href="https://www.linkedin.com/in/najja-k-a4403772"
          className=""  target="_blank"
        >
            <div className={"image-hover"}>

            </div>



        </a>

        <a href="https://github.com/nkossally" className="social-icons">
          <img></img>{" "}
        </a>
      </div>
    </div>
  );
};
